import React from "react";
import styles from "./button.module.css";

const Button = (props) => {
  const className = props.btn;
  return(
    <button type="button" className={styles.className} onClick={props.function} disabled={props.disabled}>
      {props.content}
    </button>
  );
}

export default Button;
